import React, {useEffect} from 'react';
import { Link } from "react-router-dom";

function CityData(props) {

  useEffect()
  return (
    <div>
      <input placeholder="type in a city"></input>
      <Link to="/citydata/:city">
        <button>Submit</button>
      </Link>
    </div>
  )

}

export default CityData
